/**
* Gets/Sets Fraud Report data into/from a staging table
* @company CCC Tech Center
* @version CAv4.11.0
*/
class CCTC_FraudReport
   method CCTC_FraudReport();

   method getReport(&bindVars As array of any) Returns array of array of any;

   method searchReports(&bindVars As array of any) Returns array of array of any;

   method getMaxReportId(&bindVars As array of any) Returns array of array of any;

   method setReport(&bindVars As array of any) Returns array of array of any;

   method rescindReport(&bindVars As array of any) Returns array of array of any;

   method removeReport(&bindVars As array of any) Returns array of array of any;

end-class;

method CCTC_FraudReport
   rem do nothing;
end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve Fraud Report data from a staging table
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: SIS Fraud Report Id
* @Returns first matching row (if any), empty array if not found
*/
method getReport
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 element when getting report";
   End-If;

   Local string &sisFraudReportid = &bindVars [1];
   If None(&sisFraudReportid) Then
      Error "sisFraudReportid is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_FRDRPT_STG_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve matching Fraud Reports from a staging table
* 
* @param &bindVars array of search values, appId and cccId to match against the staging table
* @Returns 2d array with rows affected in first row, first column
*/
method searchReports
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 search params";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_FRDRPT_STG_LST, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 100;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;
end-method;


/**
* This function provides an interface to the College Adaptor to 
* retrieve Fraud Report data from a staging table
* 
* @param &bindVars empty array
* @Returns first matching row (if any), empty array if not found
*/
method getMaxReportId
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 0 Then
      Error "bindVars should have 0 elements when getting max report Id";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_FRDRPT_SEQ_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* insert Fraud Report data into a staging table
* 
* @param &bindVars array of data to insert into the staging table
* @Returns 2d array with rows affected in first row, first column
*/
method setReport
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 8 Then
      Error "bindVars should have 8 elements when setting fraud report";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_FRDRPT_STG_SET, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_Duplicate Then
      Error String(&sql.Status);
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));

end-method;

/**
* This function provides an interface to the College Adaptor to 
* rescind a Fraud Report data within a staging table
* 
* @param &bindVars array of keys to remove from the staging table
* &bindVars[1]: SIS Fraud Report id of the application
* @Returns 2d array with rows affected in first row, first column
*/
method rescindReport
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 elements when rescinding a fraud report";
   End-If;

   Local string &sisFraudReportId = &bindVars [1];
   If None(&sisFraudReportId) Then
      Error "sisFraudReportId is required";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_FRDRPT_STG_RSC, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error "SQL Status not ok [" | String(&sql.Status) | "]";
   End-If;
   Local number &rowsAffected = &rowsAffected + &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));

end-method;

/**
* This function provides an interface to the College Adaptor to 
* remove Fraud Report data from a staging table
* 
* @param &bindVars array of keys to remove from the staging table
* &bindVars[1]: SIS Fraud Report id of the application
* @Returns 2d array with rows affected in first row, first column
*/
method removeReport
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 elements when removing fraud report";
   End-If;

   Local string &sisFraudReportId = &bindVars [1];
   If None(&sisFraudReportId) Then
      Error "sisFraudReportId is required";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_FRDRPT_STG_RMV, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error "SQL Status not ok [" | String(&sql.Status) | "]";
   End-If;
   Local number &rowsAffected = &rowsAffected + &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));

end-method;
